import React from 'react';
import { Image, Grid, Feed, Icon, Card, Header } from 'semantic-ui-react';

const _HeaderMovieCast = props => {

    return (
        <React.Fragment>
            <Grid className="customImageDisplayForTop5">
                <Grid.Column>
                    <Image onClick={() => alert(props.movie.id)} src={props.movieImage} className="sizeOfNewSearchMovieForTop5" /><br/>
                    <span className="customPara">{props.movie.name}</span>
                </Grid.Column>
            </Grid>
        </React.Fragment >
    )
}

export default _HeaderMovieCast;
